import React, {useState, useEffect} from 'react';
import "../App.css"
import {Link, useParams} from "react-router-dom";
import {Button,  Form,  Modal} from "react-bootstrap";


function Priziv() {
    const params = useParams();
    const prizivId = params.id

    const [priziv, setPriziv] = useState([]);

    const [show2, setShow2] = useState(false);

    const handleClose2 = async ()=> {
        setShow2(false);
        await fetch(`http://127.0.0.1:8000/prizivniki/${getInterval(min_price, max_price, value)}`, {
            method: 'GET',
        })
            .then(response => response.json())
            .then((result) => {
                setPriziv(result);
            })
    }

    const handleShow2 = ()=> setShow2(true);

    const Input1 = async (event) => {
        setMin(event.target.value);
    }
    const Input2 = async (event) => {
        setMax(event.target.value)
    }
    const Input3 = async (event) => {
        setValue(event.target.value)
    }

    const [min_price, setMin] = useState();
    const [max_price, setMax] = useState();
    const [value, setValue] = useState('');

    function getInterval (min_price, max_price, value) {
        if (min_price && max_price && value) {
            return `?vozrast_min=${min_price}&vozrast_max=${max_price}&surname=${value}`
        }
        if (min_price && max_price ) {
            return `?vozrast_min=${min_price}&vozrast_max=${max_price}`
        }
        if (min_price && value) {
            return `?vozrast_min=${min_price}&surname=${value}`
        }
        if (max_price && value) {
            return `?vozrast_max=${max_price}&surname=${value}`
        }
        if (min_price) {
            return `?vozrast_min=${min_price}`
        }
        if (max_price) {
            return `?vozrast_max=${max_price}`
        }
        if (value) {
            return `?surname=${value}`
        }
        return ('')

    }
    useEffect(() => {
        fetch(`http://127.0.0.1:8000/prizivniki/`)
            .then(response => response.json())
            .then((result) => {
                setPriziv(result);
            })
    }, []);


    const arm=(quantity, name, surname, vozrast, categoriya)=> {
        const ob = {
            quantity: quantity,
            name: name,
            surname: surname,
            vozrast: vozrast,
            categoriya: categoriya
        }
        fetch("http://127.0.0.1:8000/cart/", {
            method: "post",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify(ob)
        })
            .then(res => res.json())
            .then(res => {
                console.log(res);
            })
    }

    const del = (pk) => {
        fetch('http://127.0.0.1:8000/prizivniki/' + pk + '/', {
            method: 'DELETE',
        })
            .then(res => {
                if (res.ok) {
                    console.log("HTTP request successful");
                    window.location.reload();
                } else {
                    console.log("HTTP request unsuccessful");
                }
            })
    }

    return (
        <>
        <div>
            <Link to="/priziv">Призывники</Link>
            <div className={"assortment"}><h1>Призывники</h1></div>
            <a href="/priziv/cart" className="arm4_button">Список для отправки в армию</a><br/>
            <Button variant="primary" className="arm3_button" onClick={handleShow2}>Фильтр</Button>
            <Modal className="arm3_button" show={show2} onHide={handleClose2}>
                <Modal.Header closeButton>
                    <Modal.Title>Фильтр</Modal.Title>
                </Modal.Header>
                <Modal.Body className="arm3_button">
                    <Form>
                        <Form.Control className="arm3_button"
                            type="text"
                            className="input"
                            placeholder='Фильтр минимального числа страниц'
                            onChange={Input1}
                        />
                        <Form.Control className="arm3_button"
                            type="text"
                            className="input"
                            placeholder='Фильтр максимального числа страниц'
                            onChange={Input2}
                        />
                        <Form.Control className="arm3_button"
                            type="text"
                            className="input"
                            placeholder="Название книги"
                            onChange={Input3}
                        />
                        <Form.Group>
                            <Button className="arm3_button" variant="primary" onClick={handleClose2}>Ok</Button>
                        </Form.Group>
                    </Form>
                </Modal.Body>
            </Modal>
            <div className={"priziv_list"}>
                {priziv.map(item => (
                    <div className={"priziv"} key={"surname:" + item.surname}>
                        <Link to={`/prizivniki/${item.pk}/`}>{item.surname} {item.name}<br/></Link>
                        <a>Наличие отсрочки: {item.otsrochka}</a>
                        <input id="buy_button" className={`arm_button ${localStorage.getItem('theme')}`}
                               type="submit" value="В армию" onClick={()=>{arm(1 , item.name, item.surname, item.vozrast, item.categoriya, prizivId)}}/>
                        <input id="buy_button" className="arm_button" type="submit" value="Удалить" onClick={()=>{del(item.pk)}}/>
                        <br/>
                    </div>
                ))}
            </div>
        </div>
        </>
    );
}

export default Priziv;
